import React from 'react';
import { Breadcrumb } from 'antd';

const Nav = () => {
    return (
        <Breadcrumb
            items={[
                {
                    title: 'Home',
                },
                {
                    title: 'Services',
                },
                {
                    title: 'About',
                },
                {
                    title: 'Contact',
                },
            ]}
        />
    )
};

export default Nav;
